package leetcode.p0567;

import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class SolutionTest {

  private Solution solution = new Solution();

  @Test
  public void test() {
    assertEquals(true, solution.checkInclusion("ab", "eidbaooo"));
    assertEquals(false, solution.checkInclusion("ab", "eidboaoo"));
    assertEquals(true, solution.checkInclusion("ooa", "eidboaoo"));
  }

  @Test
  public void test2() {
    String s1 = "";
    String s2 = "";

    assertEquals(true, solution.checkInclusion(s1, s2));
  }
}
